INSERT INTO `HtmlCode` (`Id`, `HtmlCode`) VALUES
(1, '<h1 style=\"color: rgb(0, 0, 0);\"><b>Pinterest Payout&nbsp;</b><b>29 Jul to 04 Sep 2018</b></h1><p style=\"color: rgb(0, 0, 0);\">16 December 2018</p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">All Detail Updated Payouts are completed.</li></ul></blockquote><h1 style=\"color: rgb(0, 0, 0);\"><b><br></b></h1><h1 style=\"color: rgb(0, 0, 0);\"><b>Pinterest Publisher</b></h1><p style=\"color: rgb(0, 0, 0);\">09 December 2018</p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">Update Your Bank Details in <a href=\"https://onestepviral.com/osv/Pages/Profile.php\">Profile</a> Section.</li><li style=\"color: rgb(0, 0, 0);\">Complete other fields of <a href=\"https://onestepviral.com/osv/Pages/Profile.php\">Profile</a> too.</li></ul></blockquote><h1 style=\"color: rgb(0, 0, 0);\"><b>Pinterest Payout 29 Jul to 04 Sep 2018</b></h1><p style=\"color: rgb(0, 0, 0);\">06 December 2018</p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">Verification and Payout are completed successfully.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">We will contact you soon after filling your <a href=\"https://onestepviral.com/osv/Pages/Payout.php\">Payout</a> Section.</li></ul></blockquote><h1 style=\"color: rgb(0, 0, 0);\"><b><br></b></h1><h1 style=\"color: rgb(0, 0, 0);\"><b>Fb Campaign</b></h1><p style=\"color: rgb(0, 0, 0);\">01 December 2018</p><p></p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">Start sharing links via <a href=\"https://onestepviral.com/osv/Pages/FbCampaign.php\">Fb Campaign</a>.</li></ul></blockquote><p></p><h1 style=\"color: rgb(0, 0, 0);\"><b><br></b></h1><h1 style=\"color: rgb(0, 0, 0);\"><b>Instant Articles Access Lost (Incrediblenat.com)</b></h1><p style=\"color: rgb(0, 0, 0);\">09 November 2018</p><p></p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">Stop Sharing Links via <a href=\"https://onestepviral.com/osv/Pages/FbCampaign.php\" target=\"_blank\">Fb Campaign</a>.</li><li style=\"color: rgb(0, 0, 0);\">We will contact you for Instant Articles 05 November to 08 November Payouts.</li></ul></blockquote><p></p><h1 style=\"color: rgb(0, 0, 0);\"><b>Announcement</b></h1><p style=\"color: rgb(0, 0, 0);\">07 November 2018</p><p></p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">Fb Stats are updated, Continue your via fb Campaign.</li></ul></blockquote><p></p><p style=\"color: rgb(0, 0, 0);\"><br></p><h1 style=\"color: rgb(0, 0, 0);\"><b>Announcement</b></h1><p style=\"color: rgb(0, 0, 0);\">06 November 2018</p><p></p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">5 November Fb Stats and other updates will update with 6 November fb Stats.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">Thanks for being with us, Yesterday we got loss but Today is profit. Be focus on profit.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">We are doing very fast changes to continue our work. In future anything will let happen, we and you should be together to tackle it.</li></ul></blockquote><p></p><h1 style=\"color: rgb(0, 0, 0);\"><b>Facebook Payout October 2018</b></h1><p style=\"color: rgb(0, 0, 0);\">05 November 2018</p><p></p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">October Payout will not be processed for facebook publishers due to Google AdSene Account disabled.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">We are extremely thankful to you for the co-corporation.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">We are shifting traffic to Instant Article &amp; Facebook Audience Network.</li></ul></blockquote><p></p><p style=\"color: rgb(0, 0, 0);\"><br></p><h1 style=\"color: rgb(0, 0, 0);\"><b>Guide Fb Campaign</b></h1><p style=\"color: rgb(0, 0, 0);\"><b>03 November 2018</b></p><blockquote style=\"color: rgb(0, 0, 0);\"><h3>Use All 3 type (latest, trending and Top) of article links equally.</h3><p><br></p><h4>Reason:</h4><p></p><ul><li style=\"color: rgb(0, 0, 0);\">Latest article links will help to find new trending articles.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">Trending article links will help to get reach and click ratio high with new content.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">Top article links will help to maximize reach and click ratio with the help of old article links data of a certain time period.</li></ul></blockquote><p></p><p></p><h1 style=\"color: rgb(0, 0, 0);\"><b>Fb Campaign</b></h1><p style=\"color: rgb(0, 0, 0);\"><b>02 November 2018</b></p><p></p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">Congratulations to all Facebook Publishers to be with us for October 2018 Start.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">After first payout of October in November\'s End of the month,Things will go much much better.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">Tip: Use At least 5 latest article links via fb campaign in which we can differentiate new top and trending article links and Use at least 5 Top Post that we will update daily for you according to old data of top article links. By this cycle you will get new arrivals of top links for recent future days as well as daily high reach &amp; click ratio by using at least 5 top article links that we will add for you daily on fb campaign. (On topic article links and upload on Facebook page is benefit in terms of constant reach and click ratio).</li></ul></blockquote><p></p><h1 style=\"color: rgb(0, 0, 0);\"><b>Fb Campaign</b></h1><p style=\"color: rgb(0, 0, 0);\"><b>21 October 2018</b></p><p></p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">Server is working fine now, you can continue your work.</li></ul></blockquote><p style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 36px;\"><br></span></p><p style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 36px;\"><b>Server Down (Fb Campaign)</b></span><br></p><p style=\"color: rgb(0, 0, 0);\"><b>21 October 2018</b></p><p></p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">Server Team is working on it.</li><li style=\"color: rgb(0, 0, 0);\">Don\'t delete already scheduled &amp; published links.</li><li style=\"color: rgb(0, 0, 0);\">If you see <a href=\"https://incrediblenat.com/\" target=\"_blank\">IncredibleNat.com</a> is online, you can continue scheduling or publishing via <a href=\"https://onestepviral.com/osv/Pages/FbCampaign.php\">Fb Campaign</a>.</li></ul></blockquote><p></p><h1 style=\"color: rgb(0, 0, 0);\"><br></h1><h1 style=\"color: rgb(0, 0, 0);\"><b>Fb Campaign</b></h1><p style=\"color: rgb(0, 0, 0);\"><b>20 October 2018</b></p><p></p><blockquote><ul style=\"font-size: 17.5px;\"><li>Properly check your UTM Code after copying every link.</li></ul><ul style=\"font-size: 17.5px;\"><li>You can manually select and attach UTM Code with any article link of the website.</li></ul><ul style=\"font-size: 17.5px;\"><li>Maintain at least 30 Minutes to 1 Hour gap between article link post.</li></ul><ul style=\"margin-bottom: 0px; font-size: 17.5px;\"><li>We are gradually updating &amp; upgrading everything.</li></ul></blockquote><p></p><p></p><h1 style=\"color: rgb(0, 0, 0);\"><br></h1><h1 style=\"color: rgb(0, 0, 0);\"><b>Fb Stats</b></h1><p style=\"color: rgb(0, 0, 0);\"><b>14 October 2018</b></p><p></p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\"><a href=\"https://onestepviral.com/osv/Pages/FbStats.php\">Fb Stats</a> is started from 13th October 2018, RPM (Rates Per Mile) are near to average of Instant Article in August 2018.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">Currently Instant Articles RPM (Rates Per Mile)&nbsp;are very low than August 2018, Due to this condition we have worked on better and faster user interface and got succeed.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">If you start sending traffic, we will gradually update &amp; upgrade user interface.</li></ul></blockquote><p></p><h1 style=\"color: rgb(0, 0, 0);\"><b>Fb Campaign</b></h1><p style=\"color: rgb(0, 0, 0);\"><b>14 October 2018</b></p><p></p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">We have started <a href=\"https://onestepviral.com/osv/Pages/FbCampaign.php\">Fb Campaign</a> with top links of <a href=\"https://incrediblenat.com/\" target=\"_blank\">IncredibleNat.com</a> on 13th October 2018</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">The website user interface is faster &amp; 100% monetized (Mobile, Tablet &amp; Desktop).</li></ul></blockquote><p></p><h1 style=\"color: rgb(0, 0, 0);\"><b>Instant Articles Access Lost (Ujayalonepal.com)</b></h1><p style=\"color: rgb(0, 0, 0);\"><b>04 October 2018</b></p><p></p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">Delete Links of UjayaloNepal.com &amp; Don\'t pick links from Fb Campaign</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">We will get back soon.</li></ul></blockquote><p></p><h1 style=\"color: rgb(0, 0, 0);\"><b>Facebook Campaign (Instant Articles)</b></h1><p style=\"color: rgb(0, 0, 0);\"><b>02 October 2018</b></p><p></p><blockquote><p></p><ul style=\"margin-bottom: 0px; font-size: 17.5px;\"><li>Select Article links from&nbsp;<a href=\"https://onestepviral.com/osv/Pages/FbCampaign.php\">Fb Campaign</a>.</li></ul><ul style=\"margin-bottom: 0px; font-size: 17.5px;\"><li>Just click Copy Button, Article link will copy with your granted UTM Code automatically.</li></ul><ul style=\"margin-bottom: 0px; font-size: 17.5px;\"><li>Don\'t need to add UTM manually,&nbsp;<a href=\"https://onestepviral.com/osv/Pages/FbCampaign.php\">Fb Campaign</a>&nbsp;have associated with your granted UTM Code.</li></ul><p></p></blockquote><p></p><h1 style=\"color: rgb(0, 0, 0);\"><br></h1><h1 style=\"color: rgb(0, 0, 0);\"><b>Social (Pinterest) Campaign Testing Mode</b></h1><p style=\"color: rgb(0, 0, 0);\"><b>01 October 2018</b></p><h4 style=\"color: rgb(0, 0, 0);\">There are some issues with Social (Pinterest) Campaign</h4><p></p><blockquote><ul><li style=\"color: rgb(0, 0, 0);\">Google AdSense Address Verification is not completing on time, We were tried so many times. Due to this condition we have stopped the work on few thousands of dollars of total payout.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">Domain Blocked is another issue, That we can also face again. After arranging other Google AdSense, We will work on it.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">If we find any solution for Social (Pinterest) Campaign, We will start the work again with better solutions and services.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">Every thing will take time but things will get better than past.</li></ul><ul><li style=\"color: rgb(0, 0, 0);\">Thank You so much to be the part of this testing mode with One Step Viral.</li></ul></blockquote><p></p><p style=\"color: rgb(0, 0, 0);\"><br></p><h1 style=\"color: rgb(0, 0, 0);\"><b>August 2018 Payout (Facebook)</b></h1><p style=\"color: rgb(0, 0, 0);\"><b>01 October 2018</b></p><blockquote><ul style=\"margin-bottom: 0px; font-size: 17.5px;\"><li>All August 2018 Payouts have been paid.</li></ul><ul style=\"margin-bottom: 0px; font-size: 17.5px;\"><li><a href=\"https://onestepviral.com/osv/Pages/Payout.php\">Payout</a>&nbsp;Dates were 29 September - 01 October 2018.</li></ul></blockquote><h1 style=\"color: rgb(0, 0, 0);\"><br></h1><h1 style=\"color: rgb(0, 0, 0);\"><b>August 2018 Payout (Facebook)</b></h1><span style=\"font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px;\"><b>25 September 2018</b></span><p></p><blockquote><ul><li>Update your Payout / Bank Details in&nbsp;<a href=\"https://onestepviral.com/osv/Pages/Profile.php\">Profile</a>.</li></ul><ul><li>When all Facebook publishers update Payout / Bank Details, Payout dates will be disclosed at&nbsp;<a href=\"https://onestepviral.com/osv/Pages/Dashboard.php\">Dashboard</a>.</li></ul></blockquote><p></p>\n<h1 style=\"color: rgb(0, 0, 0);\"><br></h1><h1 style=\"color: rgb(0, 0, 0);\"><b>Domain Blocked by Pinterest (ViralCMS.com)</b></h1><b>05 September 2018</b><p></p><p></p><blockquote><ul><li>Delete links of <a href=\"https://viralcms.com/\">viralcms.com</a>.</li></ul><ul><li><a href=\"https://onestepviral.com/osv/Pages/Statistics.php\">Social Stats</a> will be updated of 04 September 2018.</li></ul><ul><li><a href=\"https://onestepviral.com/osv/Pages/Statistics.php\">Social Stats</a> are still estimated due to verification process of Google AdSense.</li></ul><ul><li>If we get mail and first <a href=\"https://onestepviral.com/osv/Pages/Payout.php\">Payout</a>,&nbsp;we will update you.</li></ul></blockquote><p></p><p></p><h1 style=\"color: rgb(0, 0, 0);\"><br></h1><h1 style=\"color: rgb(0, 0, 0);\"><b>Social Campaign</b></h1><b>04 September 2018</b><blockquote><ul><li>Select Article links from <a href=\"https://onestepviral.com/osv/Pages/Campaign.php\">Social Campaign</a>.<br></li><li>Just click Copy Button, Article link will copy with your granted UTM Code automatically.<br></li><li>Don\'t need to add UTM manually, <a href=\"https://onestepviral.com/osv/Pages/Campaign.php\">Social Campaign</a> have associated with your granted UTM Code.</li></ul></blockquote><h1 style=\"color: rgb(0, 0, 0);\"><br></h1><h1 style=\"color: rgb(0, 0, 0);\"><b>August 2018 Payout (Social)</b></h1><b>04 September 2018</b><blockquote><ul><li>All <a href=\"https://onestepviral.com/osv/Pages/Statistics.php\">Social Stats</a> are still estimated only.<br></li><li>Google AdSense Address Verification is not completed yet.</li></ul></blockquote>');
